 یا محدودیت پردازش در مقابل کنترل‌کننده استفاده کرده‌اید، کنترل‌کننده موظف است تمام گیرندگانی را که داده‌های شخصی شما برایشان فاش شده است، از این اصلاح یا پاک کردن داده‌ها یا محدودیت پردازش مطلع کند، مگر اینکه این امر غیرممکن یا مستلزم تلاش نامتناسب باشد.شما حق دارید در مورد این گیرندگان مطلع شوید.\n\n- حق انتقال داده ها بر اساس ماده.20 GDPR: شما این حق را دارید که داده های شخصی خود را که در اختیار ما قرار داده اید در قالبی ساختاریافته، پرکاربرد و قابل خواندن توسط ماشین دریافت کنید یا در صورت امکان، درخواست انتقال آن را به کنترل کننده دیگری بدهید.\n\n- حق پس گرفتن رضایت اعطا شده مطابق با هنر.7(3) GDPR: شما این حق را دارید که رضایت خود را برای پردازش داده ها در هر زمانی که برای آینده اعمال می کند پس بگیرید.در صورت انصراف، ما داده‌های مربوطه را بدون تأخیر حذف خواهیم کرد، مگر اینکه پردازش بیشتر براساس مبنای قانونی برای پردازش بدون رضایت باشد.انصراف از رضایت، بر قانونی بودن پردازش مبتنی بر رضایت قبل از انصراف تأثیری ندارد.\n\n- حق طرح شکایت بر اساس ماده.77 GDPR: اگر فکر می‌کنید که پردازش داده‌های شخصی شما GDPR را نقض می‌کند، حق دارید شکایتی را به یک مقام نظارتی، به‌ویژه در کشور عضو محل سکونت، محل کار یا محل تخلف ادعا شده، بدون لطمه به هر راه حل اداری یا قضایی دیگری تسلیم کنید.';

